import React, { PureComponent } from 'react';
import { withRouter } from 'react-router-dom';
import {
  Radar, RadarChart, PolarGrid, PolarAngleAxis, PolarRadiusAxis,
} from 'recharts';

const Rader = (props) => {
    const data = [
        {
          subject: 'Math', A: props.point.point_act, fullMark: 20,
        },
        {
          subject: 'Chinese', A: props.point.point_dir, fullMark: 20,
        },
        {
          subject: 'English', A: props.point.point_ost, fullMark: 20,
        },
        {
          subject: 'Geography', A: props.point.point_sto, fullMark: 20,
        },
        {
          subject: 'Physics', A: props.point.point_vis, fullMark: 20,
        }
      ];
    return (
      <RadarChart cx={100} cy={100} outerRadius={80} width={200} height={200} data={data}>
        <PolarGrid />
        <PolarAngleAxis dataKey="subject"/>
        <PolarRadiusAxis />
        <Radar name="Mike" dataKey="A" stroke="#8884d8" fill="#8884d8" fillOpacity={0.6}   />
      </RadarChart>
    );
}
export default withRouter(Rader)
